                let act = (d.m > thr && d.v < 25) ? 1 : (d.m < -thr && d.v < 32) ? -1 : 0;
                balance += (act * d.p);
                eq.push(balance); lbl.push(d.d);
            });
            if (chart) chart.destroy();
            chart = new Chart(document.getElementById('equityChart'), {
                type: 'line',
                data: { labels: lbl, datasets: [{ label: 'Equity', data: eq, borderColor: '#00d2ff', fill: true, pointRadius: 0 }] },
                options: { responsive: true, maintainAspectRatio: false }
            });
        }
        window.onload = update;
    </script>
</body>
</html>
